import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import { Button,Container,Row,Col } from 'reactstrap';
import './List.css';

function List(props) {
  
    return (
    <Container>
    {props.item.map((item, index)=>  
      <Row key={index} style={{marginTop:"10px"}}>
        <Col md="4">
          <img src={item.picture}>
          </img>
        </Col>
        <Col md="4">
          <p>
          {item.label}
          </p>
        </Col>

      </Row>
     )}
    </Container>
  );
}

export default List;
